        <ul>
            {this.props.items.map(item => (
              // <li key={item.id}>
              //   {item.text}
              //   <button onClick={this._handleDelete.bind(this, item.id)}>Delete</button>
              // </li>
              <p onClick={this.delete.bind(this, item)}>{item.text}</p>
            ))}
        </ul>
    );
}
}

export default Child;
